1	0 */4 * * *	INSERT INTO account_balances (account_id, balance_date, current_balance, available_balance)\n      SELECT id, CURRENT_DATE, current_balance, available_balance\n      FROM accounts\n      WHERE deleted_at IS NULL\n      AND NOT EXISTS (\n          SELECT 1\n          FROM account_balances\n          WHERE account_balances.account_id = accounts.id\n          AND account_balances.balance_date = CURRENT_DATE\n      );	localhost	5432	postgres	postgres	t	four_hour_account_balance_job
2	0 */4 * * *	 \n    INSERT INTO investment_holdings_daily (account_id, investment_security_id, holding_date, quantity, institution_price, institution_value, cost_basis)\n    SELECT \n        ih.account_id,\n        ih.investment_security_id,\n        CURRENT_DATE AS holding_date,\n        ih.quantity,\n        ih.institution_price,\n        ih.institution_value,\n        ih.cost_basis\n    FROM \n        investment_holdings ih\n    WHERE \n        NOT EXISTS (\n            SELECT 1 \n            FROM investment_holdings_daily ihd \n            WHERE ihd.account_id = ih.account_id\n              AND ihd.investment_security_id = ih.investment_security_id\n              AND ihd.holding_date = CURRENT_DATE\n        );\n    	localhost	5432	postgres	postgres	t	insert_daily_holdings
